#Add items: 	Jump power up to increase jump height
#		Item that increases value of platformScale
#		Health/Lives in corner (falling below min plt level spawns you on first platform)
#		Score implemented as max height reached
#		Home screen with play, help
#			Help has its own loop, press escape to go back to init
#			
.text
.globl init
init:
	li $s0, BASE_ADDRESS # $t0 stores the base address for display
	li $s1, 0x32a89d # $s1 stores the blue colour code
	li $s2, 0xa86232 # $s2 stores the platform colour code
	li $s3, LENGTH
	li $s7, 0x15ff00 # Temp player colour
	li playerY, startY
	li playerX, startX
	
	la $t0, playerVY
	sw $zero, 0($t0)
	
	la $t0, playerVX
	sw $zero, 0($t0)
	
	la $t0, powerUpVal
	sw $zero, 0($t0)
	
	la $t0, offsetY
	li $t1, INITOFF
	sw $t1, 0($t0)
	
	la $t0, playerVMax
	li $t1, MAXHV
	sw $t1, 0($t0)
	
	la $t0, pltNumber
	sw $zero, 0($t0)
	
	la $t0, playerMaxH
	li $t1, INITMAX
	sw $t1, 0($t0)
	
	la $t0, playerMinH
	li $t1, INITMIN
	sw $t1, 0($t0)
	
	la $t0, hasJumped
	sw $zero, 0($t0)
	
	la $t0, platformScale
	li $t1, DEFPLAT
	sw $t1, 0($t0)
	
	la $t0, playerJump
	li $t1, PLAYERJUMP
	sw $t1, 0($t0)
	
	li $t7,0
	j selectPlay
	
mainMenuLoop:	
	li $t1, KEYBOARD
	lw $t0, 0($t1)
	beqz $t0, mainMenuLoop
	lw $t0, 4($t1)
	beq $t0, 65, selectPlay
	beq $t0, 97, selectPlay
	beq $t0, 68, selectHelp
	beq $t0, 100, selectHelp
	beq $t0, 10, pressEnter
	j mainMenuLoop
selectPlay:
	li $t7,0
	j drawSelection
selectHelp:
	li $t7,1
	j drawSelection
pressEnter:
	bnez $t7, helpMenu
	j playGame
drawSelection:
	la $a0 startMenu
	jal fillScrn
	bnez $t7, setCursor
	li $t6, 20
	j drawSelectHelp
setCursor:
	li $t6, 284
drawSelectHelp:
	li $a0, 24
	mult $a0, $s3
	mflo $a0
	
	add $a0, $s0, $a0
	add $a0, $a0, $t6
	
	li $a1, 204
	li $a2, 0xffffff
	jal fill
	
	li $a0, 24
	mult $a0, $s3
	mflo $a0
	
	add $a0, $s0, $a0
	add $a0, $a0, $t6
	li $t0, 0
	li $t1, 0xffffff

drawVertLoop:
	bgt $t0, 20, doneVert
	sw $t1, 0($a0)
	sw $t1, 204($a0)
	
	add $a0, $a0, $s3
	add $t0, $t0, 1
	j drawVertLoop
doneVert:	
	li $a0, 44
	mult $a0, $s3
	mflo $a0
	
	add $a0, $s0, $a0
	add $a0, $a0, $t6
	
	li $a1, 204
	li $a2, 0xffffff
	jal fill
	
	j mainMenuLoop
	
helpMenu:
	la $a0 helpscrn
	jal fillScrn
helpMenuLoop:
	li $t1, KEYBOARD
	lw $t0, 0($t1)
	beqz $t0, helpMenuLoop
	lw $t0, 4($t1)
	
	beq $t0, 81, returnMenu
	beq $t0, 113, returnMenu
	j helpMenuLoop
returnMenu:
	j init
	
winScreenMenu:
	la $a0 winscreen
	jal fillScrn
winScreenMenuLoop:
	li $t1, KEYBOARD
	lw $t0, 0($t1)
	beqz $t0, winScreenMenuLoop
	lw $t0, 4($t1)
	
	beq $t0, 81, QUIT
	beq $t0, 113, QUIT
	beq $t0, 80, init
	beq $t0, 112, init
	j winScreenMenuLoop

spwnPlt:	#Spawns random plt at posY $a0
	move $s1, $ra
	
	move $t1, $a0	#Y pos
	li $a0, 80
	jal genRan				
	move $t0, $v0	#X pos
	
	
	li $a0, 3
	jal genRan
	andi $v0, $v0, 1
	move $t2, $v0	#Current Dir
	
	li $a0, 2
	jal genRan
	move $t3, $v0	#Movement Type
	
	li $a0, 10
	jal genRan
	move $t4, $v0	#Length
	addi $t4, $t4, 5
	
	addi $sp, $sp, 4
	sw $t0, 0($sp)
	addi $sp, $sp, 4
	sw $t1, 0($sp)
	addi $sp, $sp, 4
	sw $t2, 0($sp)
	addi $sp, $sp, 4
	sw $t3, 0($sp)
	addi $sp, $sp, 4
	sw $t4, 0($sp)
	
	jal mkPlt
	move $t0, $v0
	
	#Randomize offsets
	li $a0, 13
	jal genRan
	move $t4, $v0	
	sll $t4, $t4, 12
	add $t0, $t0, $t4
	
	li $a0, 13
	jal genRan
	move $t4, $v0	
	addi $t4, $t4, 1
	sll $t4, $t4, 8
	add $t0, $t0, $t4
	move $v0, $t0
	jr $s1
	
playGame:
	la $a0 background
	jal fillScrn
	
	li $t7, 0
	li $t9, 120
mkPltLoop:
	bgt $t7, PLATFORMBYTE, mkPltLoopEnd
	
	move $a0, $t9
	
	jal spwnPlt
	
	move $t0, $v0
	
	#Store in platforms array
	la $t6, platforms
	add $t6, $t6, $t7
	sw $t0, 0($t6)
	
	addi $t7, $t7, 4
	sub $t9, $t9, LAYERSEP
	move $a0, $t0
	
	move $a1, $s2
	jal drwPlt
	j mkPltLoop
mkPltLoopEnd:
	jal spawnObj
	la $a0, object 
	sw $v0, 0($a0)
	move $a0, $v0
	jal drawObj
	
	la $a0, platforms
	lw $a0, 0($a0)
	
	jal pltTY
	move playerY, $v0
	subi playerY, playerY, 2
	
	jal pltTX
	move playerX, $v0
	
	jal pltLen
	la $t0, platformScale
	lw $t0, 0($t0)
	mult $v0, $t0
	li $v0, 2
	mult $v0, $t0
	mflo $t0
	add playerX, playerX, $t0
MAIN:	
	blt playerY, PLAYERWIN, winScreenMenu

	jal updatePlayer
	
	la $t0, offsetY
	lw $t1, 0($t0)
	div $t1, $t1, $s3
	addi $t1, $t1, PLAYERWIN
	bltz $t1, winNotVis
	mult $t1, $s3
	mflo $a0
	add $a0, $a0, $s0
	move $a1, $s3
	li $a2 0xffff00
	jal fill
	
winNotVis:
	li $t8, 0
	la $t9, platforms
drwPltLoop:
	bgt $t8, PLATFORMBYTE, drwPltLoopEnd
	lw $a0, 0($t9)
	jal updtPlt
	#jal mvPltR
	sw $v0, 0($t9)
	add $t8, $t8, 4
	add $t9, $t9, 4
	j drwPltLoop
drwPltLoopEnd:
	la $a0, object
	lw $a0, 0($a0)
	jal drawObj
	
	
	la $a0, object
	lw $a0, 0($a0)
	move $t5, $a0
	jal updateObj
	
	la $t3, powerUpVal
	lw $t4, 0($t3)
	bgt $t4, 256, displayPower1
	blt $t4, 256, displayPower2
	li $t4, 0
	sw $t4, 0($t3)
	
	j displayPowerEnd
displayPower1:
	li $a2, 0xff0000
	subi $a1, $t4, 256
	j fillPower
displayPower2:
	beqz $t4, displayPowerEnd
	li $a2, 0x0000ff
	move $a1, $t4
fillPower:
	add $a0, $zero, 12
	move $t5, $a0
	move $t6, $a1
	add $a1, $a1, 4
	
	jal replaceCol
	
	add $a0, $t5, $s0
	move $a1, $t6
	jal fill
	
	la $t3, powerUpVal
	subi $t4, $t4, 1
	sw $t4, 0($t3)
	beqz $t4, resetPower
	beq $t4, 256, resetPower
	j displayPowerEnd
resetPower:
	li $t8, 0
	la $t9, platforms
powerClrPltLoop:
	bgt $t8, PLATFORMBYTE, powerClrPltLoopEnd
	lw $a0, 0($t9)
	jal clrPlt
	
	add $t8, $t8, 4
	add $t9, $t9, 4
	j powerClrPltLoop
powerClrPltLoopEnd:

	la $t3, playerJump
	li $t4, PLAYERJUMP
	sw $t4, 0($t3)
	
	la $t3, platformScale
	li $t4, DEFPLAT
	sw $t4, 0($t3)
	
displayPowerEnd:
	la $t0, offsetY
	lw $t1, 0($t0)

	move $t2, playerY
	mult $s3, $t2
	mflo $t2
	
	add $t2, $t2, $t1
	
	li $t3, 5
	mult $t3, $s3
	mflo $t3
	
	blt $t2, $t3, offIncreasePre
	li $t3, 59
	mult $t3, $s3
	mflo $t3
	bgt $t2, $t3, offDecreasePre
	j noOffChange
offDecreasePre:
	la $s4, offDecreasePost
	j offClrPlt
offIncreasePre:
	la $t0, playerMaxH
	lw $t1, 0($t0)

	bge playerY, $t1, noChangeMax
	move $t7, $t1
	sw playerY, 0($t0)
	li $t2, LAYERSEP
passedLayerLoop:
	ble $t1, playerY, passedLayerLoopEnd
	div $t1, $t2
	subi $t1, $t1, 1
	mfhi $t3
	bnez $t3, passedLayerLoop
	
	li $t2, LAYERSEP
	div playerY, $t2
	mflo $t0
	mult $t0, $t2
	mflo $a0
	
	subi $a0, $a0, 10
	
	jal spwnPlt
	
	la $t1 platforms
	la $t0, pltNumber
	lw $t2, 0($t0)
	
	ble $t2, PLATFORMBYTE, noChangeMin
	li $t2, 0
	
	la $t3, playerMinH
	
	add $t4, playerY, 70
	sw $t4, 0($t3)
noChangeMin:
	add $t1, $t1, $t2
	add $t2, $t2, 4
	sw $t2, 0($t0)	
	lw $t6, 0($t1)
	
	sw $v0, 0($t1)	
	move $a0, $v0
	move $a1, $s2
	jal drwPlt
	
	move $a0, $t6
	jal clrPlt
	
	j passedLayerLoopEnd
passedLayerLoopEnd:
	
noChangeMax:	
	la $s4, offIncreasePost
offClrPlt:
	la $t0, offsetY
	lw $t1, 0($t0)
	div $t1, $t1, $s3
	addi $t1, $t1, PLAYERWIN
	bltz $t1, winNotVisReplace
	mult $t1, $s3
	mflo $a0
	move $a1, $s3
	jal replaceCol
	
winNotVisReplace:
	jal clearPlayer
	li $t8, 0
	la $t9, platforms
offClrPltLoop:
	bgt $t8, PLATFORMBYTE, offClrPltLoopEnd
	lw $a0, 0($t9)
	jal clrPlt
	
	add $t8, $t8, 4
	add $t9, $t9, 4
	j offClrPltLoop
offClrPltLoopEnd:
	la $t0, object
	lw $a0, 0($t0)
	jal clrObj
	
	jr $s4
offDecreasePost:
	la $t0, offsetY
	lw $t1, 0($t0)
	
	la $t2 playerVY
	lw $t2, 0($t2)
	
	li $t3, 1
offDecreasePostLoop:
	blt $t3, $t2, offDecreasePostLoopEnd
	sub $t1, $t1, $s3
	subi $t3, $t3, 1
	j offDecreasePostLoop
offDecreasePostLoopEnd:
	sw $t1, 0($t0)
	j doneClearing
offIncreasePost:
	la $t0, offsetY
	lw $t1, 0($t0)
	la $t2 playerVY
	lw $t2, 0($t2)
	
	li $t3, -1
offIncreasePostLoop:
	bgt $t3, $t2, offIncreasePostLoopEnd
	add $t1, $t1, $s3
	addi $t3, $t3, 1
	j offIncreasePostLoop
offIncreasePostLoopEnd:
	sw $t1, 0($t0)
doneClearing:
	la $t0, object
	lw $a0, 0($t0)
	jal drawObj

	jal drawPlayer

	li $t8, 0
	la $t9, platforms
drwPltUpdtLoop:
	bgt $t8, PLATFORMBYTE, noOffChange
	lw $a0, 0($t9)
	jal updtPlt
	
	sw $v0, 0($t9)
	add $t8, $t8, 4
	add $t9, $t9, 4
	j drwPltUpdtLoop
	
noOffChange:
	li $v0, 32
	li $a0, TIMING
	syscall
	move $a0, $t7
	j MAIN
	
updateObj:
	move $t8, $ra
	
	la $t0, powerUpVal
	lw $t0, 0($t0)
	
	bnez $t0, objNoTouch
	
	jal pltY
	
	
	jal pltY
	la $t1, playerMinH
	lw $t1, 0($t1)
	bgt $v0, $t1, spawnNewObj
	
	move $t1, $v0
	move $t5, $a0,
	sub $t2, $t1, playerY
	blt $t2, -2, objNoTouch
	bgt $t2, 2, objNoTouch
	
	jal pltX
	move $t0, $v0

	sub $t2, $t0, playerX
	blt $t2, -2, objNoTouch
	bgt $t2, 2, objNoTouch
	
	li $a0, 4
	mult $a0, $t0
	mflo $a0
	
	mult $t1, $s3
	mflo $t1
	add $a0, $a0, $t1
	move $t4, $a0	
	li $a1, 8
	
	la $t0, offsetY
	lw $t0, 0($t0)
	add $a0, $a0, $t0
	
	jal replaceCol
	
	add $a0, $t4, $s3
	
	la $t0, offsetY
	lw $t0, 0($t0)
	add $a0, $a0, $t0
	
	li $a1, 8
	jal replaceCol
	
	andi $t7, $t5, 255	#Get duration
	andi $t1, $t5, 3840	#Get type
	bgtz $t1, touchedRed
	#Touched Blue
	la $t2, playerJump
	li $t3, POWERJUMP
	sw $t3, 0($t2)
	j enablePower
touchedRed:
	li $t5, 0
	la $t9, platforms
powerUpClrPltLoop:
	bgt $t5, PLATFORMBYTE, powerUpClrPltLoopEnd
	lw $a0, 0($t9)
	jal clrPlt
	
	add $t5, $t5, 4
	add $t9, $t9, 4
	j powerUpClrPltLoop
powerUpClrPltLoopEnd:

	la $t2, platformScale
	li $t3, POWERSCALE
	sw $t3, 0($t2)
	addi $t7, $t7, 256
enablePower:
	la $t1, powerUpVal
	sw $t7, 0($t1)
spawnNewObj:
	jal spawnObj
	
	la $a0, object
	sw $v0, 0($a0)
objNoTouch:	
	jr $t8
	
spawnObj:	#Creates random powerup at random pos
	move $t6, $ra
	li $a0, 90
	jal genRan				
	move $t0, $v0	#X pos
	add $t0, $t0, 15
	sll $t0,$t0, 24
	
	li $a0, 20
	jal genRan
	move $t1, $v0	#Y pos
	add $t1, $t1, playerY
	subi $t1, $t1, 10
	sll $t1,$t1, 16
	
	li $a0, 50
	jal genRan
	bgt $v0, 25, genRed
	li $t2, 0
	j joinType
genRed:	li $t2,	1
joinType:
	sll $t2,$t2, 8	#Type
	
	li $a0, 127
	jal genRan
	move $t3, $v0	#Duration
	addi $t3, $t3, 127
	
	or $v0, $t0, $t1
	or $v0, $v0, $t2
	or $v0, $v0, $t3
	jr $t6
	
drawObj:	#Draws powerup stored i $a0
	move $t7, $ra
	jal pltX
	move $t3, $v0
	li $v0, 4
	mult $t3, $v0
	mflo $t3
	add $t3, $t3, $s0
	
	jal pltY
	move $t4, $v0
	mult $t4, $s3
	mflo $t4
	
	add $t3, $t3, $t4
	
	la $t4, offsetY
	lw $t4, 0($t4)
	add $t3, $t3, $t4
	
	andi $t4, $a0, 3840	#Mask to extract powerup type
	srl $t4, $t4, 8 
	beqz $t4, colorBlue
	li $a2, 0x00ff0000	#Color obj red
	j fillObj
colorBlue:
	li $a2, 0x0000ff
fillObj:
	move $a0, $t3
	li $a1, 8
	jal fill
	
	add $t3, $t3, $s3
	move $a0, $t3
	li $a1, 8
	jal fill
			
	jr $t7

clrObj:	#Clears powerup stored in $a0
	move $t7, $ra
	jal pltX
	move $t3, $v0
	li $v0, 4
	mult $t3, $v0
	mflo $t3
	
	jal pltY
	move $t4, $v0
	mult $t4, $s3
	mflo $t4
	
	add $t3, $t3, $t4
	
	la $t4, offsetY
	lw $t4, 0($t4)
	add $t3, $t3, $t4
	
	
	move $a0, $t3
	li $a1, 8
	jal replaceCol
	
	add $t3, $t3, $s3
	move $a0, $t3
	li $a1, 8
	jal replaceCol
			
	jr $t7
			
		#CLEARS ALL REGISTERS
checkBound:	#Checks for platform existence at position (playerX+$a0, playerY+$a1) and returns 0 or 1 ($a0 will hold the platform that was collided with)
	move $t9 $ra
	add $t0, $a0, playerX
	add $t1, $a1, playerY
	la $t2, platforms
	add $t3, $t2, PLATFORMBYTE
	#Loop through every platform
boundPltLoop:
	bgt $t2, $t3, boundPltEnd
	lw $a0, 0($t2)
	jal pltY
	move $t4, $v0
	jal pltFY
	add $t4, $t4, $v0
	sub $t4, $t1, $t4
	blt $t4, -1, boundPltXLoopEnd
	bgt $t4, 1, boundPltXLoopEnd
	
	jal pltX
	move $t4, $v0
	jal pltFX
	la $t6, platformScale
	lw $t6, 0($t6)
	mult $v0, $t6
	mflo $v0
	add $t4, $t4, $v0
	jal pltLen
	mult $v0, $t6
	mflo $v0
	add $v0, $v0, $t4
	#Loop through every x value of length from platform
boundPltXLoop:
	bgt $t4, $v0, boundPltXLoopEnd
	add $t4, $t4, 1
	sub $t6, $t0, $t4
	
	bgt $t6, 2, boundPltXLoop
	blt $t6, -2, boundPltXLoop
	j yesColl
	
	j boundPltXLoop
boundPltXLoopEnd:
	addi $t2, $t2, 4
	j boundPltLoop
yesColl:	
	li $v0, 1
	j boundReturn
boundPltEnd:
	li $v0, 0
boundReturn:
	jr $t9
	
playerDied:
	la $a0 endscreen
	jal fillScrn
deathMenuLoop:	
	li $t1, KEYBOARD
	lw $t0, 0($t1)
	beqz $t0, deathMenuLoop
	lw $t0, 4($t1)
	beq $t0, 80, init
	beq $t0, 112, init
	beq $t0, 81, QUIT
	beq $t0, 113, QUIT
	j deathMenuLoop
	
updatePlayer:
	move $t5, $ra
	
	la $t0, playerMinH
	lw $t0, 0($t0)
	bgt playerY, $t0, playerDied
	
	jal clearPlayer
	
	la $t0, playerVY
	lw $t0, 0($t0)
	
	beqz $t0, plyrOnPlt
	bgtz $t0, plyrJmp
	#Player is currently falling
	j plyrOnPlt
plyrJmp:
	la $t8, playerVY
	lw $t8, 0($t8)
	li $s4, -1
playerJmpChck:
	beqz $t8, calcJump
	li $a0, 3
	move $a1, $s4
	jal checkBound
	beq $v0, 1, calcJump
	subi $t8, $t8, 1
	subi $s4, $s4, 1
	j playerJmpChck
calcJump:
	la $a0, playerVY
	lw $a0, 0($a0)
	sub $t0, $a0, $t8
	sub playerY, playerY, $t0
	sub $a0, $a0, 1
	beqz $t8, noHit
	la $t1, playerVY
	sw $zero, 0($t1)
	addi playerY, playerY, 1
	j dontTrackPlt
noHit:
	la $t1, playerVY
	sw $a0, 0($t1)
	j dontTrackPlt
plyrOnPlt:
	li $a0, 3
	li $a1, 1
	jal checkBound	
	
	beqz $v0, playerFall
	#addi playerY, playerY, 1
	la $t0, hasJumped
	sw $zero, 0($t0)
	
	la $t0, playerVY
	li $t1, 0
	sw $t1, 0($t0)

	la $t0, playerVX
	lw $t1, 0($t0)
	
	bltz $t1, slowLeft
	bgtz $t1, slowRight
	j doneFriction
slowLeft:
	addi $t1, $t1, 1
	sw $t1, 0($t0)
	j doneFriction
slowRight:
	subi $t1, $t1, 1
	sw $t1, 0($t0)
	j doneFriction
doneFriction:		
	jal pltDir
	move $t2, $v0
	jal pltMv
	li $t0, PLATHOR
	beq $v0, $t0 pltH
	
	li $t0, PLATVERT
	beq $v0, $t0, pltV
	
	li $t0, PLATUPL
	beq $v0, $t0, pltUL
	
	li $t0, PLATUPR
	beq $v0, $t0, pltUR
pltH:
	beqz $t2, movePlyrLft
	la $t1, platformScale
	lw $t1, 0($t1)
	add playerX, playerX, $t1
	j dontTrackPlt
movePlyrLft:
	la $t1, platformScale
	lw $t1, 0($t1)
	sub playerX, playerX, $t1
	j dontTrackPlt
pltV:
	beqz $t2, movePlyrDwn
	sub playerY, playerY, 1
	j dontTrackPlt
movePlyrDwn:
	add playerY, playerY, 1
	j dontTrackPlt
pltUR:
pltUL:
playerFall:
	la $t0, playerVY
	lw $t7, 0($t0)
	li $s4, 1
playerFallChck:
	beqz $t7, calcFall
	li $a0, 3
	move $a1, $s4
	jal checkBound
	beq $v0, 1, calcFall
	addi $t7, $t7, 1
	addi $s4, $s4, 1
	j playerFallChck
calcFall:
	add playerY, playerY, $s4
	
	la $a0, playerVY
	lw $t2, 0($a0)
	beqz $t7, noFallHit
	li $t2, 0
	j maxFallSpeed
noFallHit:
	blt $t2, -3, maxFallSpeed
	subi $t2, $t2, 1
maxFallSpeed:
	sw $t2, 0($a0)
dontTrackPlt:	
	li $t1, KEYBOARD
	lw $t0, 0($t1)
	beqz $t0, keyCaseEnd
	lw $t0, 4($t1)
	beq $t0, 32, keyCaseSpace
	beq $t0, 97, keyCaseA
	beq $t0, 65, keyCaseA
	beq $t0, 68, keyCaseD
	beq $t0, 100, keyCaseD
	beq $t0, 83, keyCaseS
	beq $t0, 115, keyCaseS
	beq $t0, 119, keyCaseW
	beq $t0, 87, keyCaseW
	beq $t0, 112, keyCaseP
	beq $t0, 80, keyCaseP
	beq $t0, 32, keyCaseSpace
	j NoMove
keyCaseP:
	j init
keyCaseSpace:
	la $t4, hasJumped
	lw $t3, 0($t4)
	bgt $t3, PLAYERJUMPNUM, keyCaseEnd
	
	la $t0, playerVY
	la $t1, playerJump
	lw $t1, 0($t1)
	lw $t2, 0($t0)
	
	add $t2, $t2, $t1
	sw $t2, 0($t0)
	sub playerY, playerY, 1
	
	add $t3, $t3, 1
	sw $t3, 0($t4)
	
	j keyCaseEnd
keyCaseA:
	la $t0, playerVX
	lw $t1, 0($t0)
	subi $t1, $t1, 1
	la $t2, playerVMax
	lw $t2,0($t2)
	sub $t2, $zero, $t2
	bge $t1, $t2, changeVLeft
	addi $t1, $t1, 1	
changeVLeft:	
	sw $t1, 0($t0)
	j keyCaseEnd
keyCaseD:
	la $t0, playerVX
	lw $t1, 0($t0)
	addi $t1, $t1, 1
	la $t2, playerVMax
	lw $t2,0($t2)
	
	ble $t1, $t2, changeVLeft
	subi $t1, $t1, 1	
changeVRight:	
	sw $t1, 0($t0)
	j keyCaseEnd
keyCaseW:
	sub playerY, playerY, 1
	j keyCaseEnd
keyCaseS:
	add playerY, playerY, 1
	j keyCaseEnd
keyCaseEnd:
	la $t1, playerVX
	lw $t1, 0($t1)
	add playerX, playerX, $t1
	ble playerX, 124, checkRightWall
	
	li $t1, 0
	la $t0, playerVX
	lw $t1, 0($t0)
	
	li playerX, 124
	j NoMove
checkRightWall:
	bgez playerX, NoMove
	
	li $t1, 0
	la $t0, playerVX
	lw $t1, 0($t0)
	li playerX, 0
NoMove:
	jal drawPlayer
	jr $t5
	
clearPlayer:
	move $t4, $ra
	move $t2, playerY
	li $t1, LENGTH
	mult $t2, $t1
	mflo $t2
	li $t1, 4
	mult playerX, $t1
	mflo $t1
	add $t3, $t2, $t1
	
	move $a0, $t3
	
	la $t0, offsetY
	lw $t0, 0($t0)
	add $a0, $a0, $t0
	
	li $a1, 16
	jal replaceCol
	
	sub $t3, $t3, $s3
	move $a0, $t3
	
	la $t0, offsetY
	lw $t0, 0($t0)
	add $a0, $a0, $t0
	
	li $a1, 16
	jal replaceCol
	
	jr $t4
	
drawPlayer:#Draws player at specified coordinates in x,y
	move $t4, $ra
	move $t2, playerY
	li $t1, LENGTH
	mult $t2, $t1
	mflo $t2
	li $t1, 4
	mult playerX, $t1
	mflo $t1
	add $t2, $t2, $t1
	add $t2, $t2, $s0
	
	la $t1, offsetY
	lw $t1, 0($t1)
	add $t2, $t2, $t1
	
	move $a0, $t2
	li $a1, 16
	move $a2, $s7
	jal fill
	
	sub $t2, $t2, $s3
	move $a0, $t2
	li $a1, 16
	move $a2, $s7
	jal fill
	
	jr $t4
	
updtPlt:#Updates platfrom position, and does partial redraws
	move $s4, $ra
	
	jal pltTY
	la $t0, offsetY
	lw $t0, 0($t0)
	div $t0, $t0, $s3
	add $v0, $v0, $t0
	
	bgt $v0, 75, updtEND
	blt $v0, -15, updtEND
	
	jal pltMv
	move $t1 $v0
	
	li $t0, PLATHOR
	beq $t1, $t0 updtH
	
	li $t0, PLATVERT
	beq $t1, $t0, updtV
	
	li $t0, PLATUPL
	beq $t1, $t0, updtUL
	
	li $t0, PLATUPR
	beq $t1, $t0, updtUR
updtH:
	jal pltFX
	move $t0, $v0
	li $t1, 15
	beqz $t0, updtFlipH
	beq $t0, $t1 updtFlipH
	j updtHPos
updtFlipH:
	li $t1, 128		#Get mask for dir flag
	xor $a0, $a0, $t1
updtHPos:
	li $t1, 128		#Get mask for dir flag
	and $t1, $a0, $t1	#Extract dir flag 
	beqz $t1, updtL
	#Going right
	jal mvPltR
	j updtEND
updtL:	#Going left
	jal mvPltL
	j updtEND
updtV:
	jal pltFY
	move $t0, $v0
	li $t1, 15
	beqz $t0, updtFlipV
	beq $t0, $t1 updtFlipV
	j updtVPos
updtFlipV:
	li $t1, 128		#Get mask for dir flag
	xor $a0, $a0, $t1
updtVPos:
	li $t1, 128		#Get mask for dir flag
	and $t1, $a0, $t1	#Extract dir flag 
	beqz $t1, updtD
	#Going up
	jal mvPltU
	j updtEND
updtD:	#Going Down
	jal mvPltD
	j updtEND
updtUL:
	jal pltFX
	move $t0, $v0
	li $t1, 15
	beqz $t0, updtFlipUL
	beq $t0, $t1 updtFlipUL
	j updtULPos
updtFlipUL:
	li $t1, 128		#Get mask for dir flag
	xor $a0, $a0, $t1
updtULPos:
	li $t1, 128		#Get mask for dir flag
	and $t1, $a0, $t1	#Extract dir flag 
	beqz $t1, updtUpL
	#Going right
	jal mvPltR
	move $a0, $v0
	jal mvPltD
	j updtEND
updtUpL:	#Going left
	jal mvPltL
	move $a0, $v0
	jal mvPltU
	j updtEND

updtUR:
	jal pltFX
	move $t0, $v0
	li $t1, 15
	beqz $t0, updtFlipUR
	beq $t0, $t1 updtFlipUR
	j updtURPos
updtFlipUR:
	li $t1, 128		#Get mask for dir flag
	xor $a0, $a0, $t1
updtURPos:
	li $t1, 128		#Get mask for dir flag
	and $t1, $a0, $t1	#Extract dir flag 
	beqz $t1, updtUpR
	#Going right
	jal mvPltR
	move $a0, $v0
	jal mvPltU
	j updtEND
updtUpR:	#Going left
	jal mvPltL
	move $a0, $v0
	jal mvPltD
	j updtEND
updtEND:
	move $v0, $a0
	jr $s4
	
genRan: #Generates a random number up to $a0
	li $v0, 42
	move $a1, $a0
	move $a0, $ra
	syscall
	move $v0, $a0
	jr $ra
	
replaceCol:	#Fills from $a0+base to ($a0+$a1+base) with colour background
	add $t0, $a1, $a0
	la $t1, background
	add $t1, $t1, $a0
	
	add $a0, $a0, $s0
	blt $a0, $s0, replaceColLoopEnd
	add $t0, $t0, $s0
	
replaceColLoop:
	bgt $a0, $t0, replaceColLoopEnd
	lw $t2, 0($t1)
	sw $t2, 0($a0)
	#addi $a0, $a0, 32768
	addi $a0, $a0, 4
	addi $t1, $t1, 4
	j replaceColLoop
replaceColLoopEnd:
	jr $ra
		
drwPlt:	#Draws *entire* platform stored in a0, w/ colour stored in a1
	#Retrieves platform data
	#lw $a0, 0($sp)
	#addi $sp, $sp, -4
	
	#Stores original $ra
	move $t4, $ra
	
	jal pltTY
	la $t0, offsetY
	lw $t0, 0($t0)
	div $t0, $t0, $s3
	add $v0, $v0, $t0
	
	move $t3, $a0
	bgt $v0, 75, drwPltEnd
	blt $v0, -15, drwPltEnd	
	
	#Calculate current x,y pos
	jal pltTX
	li $t1, 4
	mult $v0, $t1
	mflo $t3
	
	jal pltTY
	move $t1, $v0
	move $t0, $t3
	
	#initialize pixel cursor pos
	li $v0, LENGTH
	li $t2, BASE_ADDRESS
	mult $t1, $v0
	mflo $v0
	add $t0, $t0, $v0
	add $t0, $t0, $t2
	
	la $t1, offsetY
	lw $t1, 0($t1)
	add $t0, $t0, $t1
	
	jal pltLen
	la $t3, platformScale
	lw $t3, 0($t3)
	
	mult $v0, $t3
	mflo $v0
	li $t3, 4
	mult $v0, $t3
	mflo $v0
	
	move $t3, $a0
	
	move $a0, $t0
	move $a2, $a1
	move $a1, $v0
	
	jal fill
	
	move $v0, $t3
drwPltEnd:
	jr $t4

fillScrn:#Fill whole screen with pic at address in $a0
	move $t0, $s0
	li $t1, HEIGHT
	mult $s3, $t1
	mflo $t1
	div $t1, $t1 4
	add $t1, $t1, $s0
	move $t3, $a0
flScrnLoop:
	bgt $t0, $t1, flScrEnd
	lw $t4, 0($t3)
	sw $t4, 0($t0)
	addi $t0, $t0, 4
	addi $t3, $t3, 4
	j flScrnLoop
flScrEnd:
	jr $ra

fill:	#Fills from $a0 to ($a0+$a1) with colour $a2
	blt $a0, $s0, fillLoopEnd
	add $t0, $a1, $a0
fillLoop:
	bgt $a0, $t0, fillLoopEnd
	sw $a2, 0($a0)
	#addi $a0, $a0, 32768
	addi $a0, $a0, 4
	div $a0, $s3
	mfhi $a3
	beqz $a3, fillLoopEnd
	j fillLoop
fillLoopEnd:
	jr $ra
	


mkPlt:	#This function generates a platform at pos (a0, a1), with direction a2, dirtype a3, len a4
	lw $t4, 0($sp)
	andi $t4, $t4, 15
	addi $sp, $sp, -4
	lw $t3, 0($sp)
	andi $t3, $t3, 3
	addi $sp, $sp, -4
	lw $t2, 0($sp)
	andi $t2, $t2, 1
	addi $sp, $sp, -4
	lw $t1, 0($sp)
	andi $t1, $t1, 255
	addi $sp, $sp, -4
	lw $t0, 0($sp)
	andi $t0, $t0, 255
	addi $sp, $sp, -4
	
	move $t5, $zero
	sll $t0,$t0,24 #Range should be 0 ~ 256
	sll $t1,$t1,16 #Range should be 0 ~ 256
	sll $t2,$t2,7 #Range should be 0 ~ 1
	sll $t3,$t3,5 #Range should be 0 ~ 4
	sll $t4,$t4,1 #Range should be 0 ~ 16
	
	or $t5, $t0, $t1
	or $t5, $t5, $t2
	or $t5, $t5, $t3
	or $t5, $t5, $t4
	ori $t5, $t5, 1
	move $v0, $t5
	jr $ra

#This set of functions will save positions in $t5
mvPltL:
	move $t5, $ra #Storing caller pos
	
	#Set new left-end to platform
	jal pltTX
	move $t0, $v0
	li $t1, 4
	mult $t0, $t1
	mflo $t0
	add $t4, $t0, $s0
	
	jal pltTY
	move $t1, $v0
	mult $t1, $s3
	mflo $t1
	add $t4, $t4, $t1	
	
	move $t6, $a0
	move $a0, $t4
	la $a1, platformScale
	lw $a1, 0($a1)
	li $a2, 4
	mult $a1, $a2
	mflo $a1
	move $a2, $s2
	sub $a0, $a0, $a1 #Offset in left direction
	
	la $t0, offsetY
	lw $t0, 0($t0)
	add $a0, $a0, $t0
	
	jal fill
	
	
	#Set old right-end to nothing
	move $a0, $t6
	jal pltLen
	move $t1, $v0
	la $v0, platformScale
	lw $v0, 0($v0)
	
	mult $t1, $v0
	mflo $t1
	
	li $v0, 4
	mult $t1, $v0
	mflo $t1
	add $t4, $t4, $t1
	
	move $a0, $t4
	la $a1, platformScale
	lw $a1, 0($a1)
	
	li $t3, 4
	mult $a1, $t3
	mflo $a1
	sub $a0, $a0, $a1 #Offset in left direction
	
	sub $a0, $a0, $s0
	
	la $t0, offsetY
	lw $t0, 0($t0)
	add $a0, $a0, $t0
	
	jal replaceCol
	move $a0, $t6
	
	#Update offset position
	li $t0, 1
	sll $t0, $t0, 12
	sub $a0, $a0, $t0
	move $v0, $a0
	jr $t5

mvPltR:
	move $t5, $ra #Storing caller pos
	
	#Set old left-end to nothing
	jal pltTX
	move $t0, $v0
	li $t1, 4
	mult $t0, $t1
	mflo $t4
	
	jal pltTY
	move $t1, $v0
	mult $t1, $s3
	mflo $t1
	add $t4, $t4, $t1	
	
	move $t6, $a0
	move $a0, $t4
	la $a1, platformScale
	lw $a1, 0($a1)
	li $a2, 4
	mult $a1, $a2
	mflo $a1
	
	la $t0, offsetY
	lw $t0, 0($t0)
	add $a0, $a0, $t0
	
	jal replaceCol
	
	move $a0, $t6
	
	#Set new right-end to platform
	jal pltLen
	move $t1, $v0
	la $v0, platformScale
	lw $v0, 0($v0)
	
	mult $t1, $v0
	mflo $t1
	li $v0, 4
	mult $t1, $v0
	mflo $t1
	
	add $t4, $t4, $s0
	add $t4, $t4, $t1
	
	move $a0, $t4
	la $a1, platformScale
	lw $a1, 0($a1)
	
	li $t3, 4
	mult $a1, $t3
	mflo $a1
	move $a2, $s2
	
	la $t0, offsetY
	lw $t0, 0($t0)
	add $a0, $a0, $t0
	
	jal fill
	move $a0, $t6
	
	#Update offset position
	li $t0, 1
	sll $t0, $t0, 12
	add $a0, $a0, $t0
	move $v0, $a0
	jr $t5

mvPltD:
	move $t5, $ra

	jal clrPlt
	move $a0, $t6
	
	
	li $t1, 1
	sll $t1, $t1, 8
	
	add $a0, $a0, $t1
	
	move $a1, $s2
	jal drwPlt
	move $a0, $v0	
	jr $t5

mvPltU:
	move $t5, $ra
	jal clrPlt
	move $a0, $t6
	
	li $t1, 1
	sll $t1, $t1, 8
	
	sub $a0, $a0, $t1
	move $a1, $s2
	jal drwPlt
	move $a0, $v0
	jr $t5

clrPlt:
	move $t3, $ra
	jal pltTY
	la $t0, offsetY
	lw $t0, 0($t0)
	div $t0, $t0, $s3
	add $v0, $v0, $t0
	
	bgt $v0, 75, clrPltEnd
	blt $v0, -15, clrPltEnd
	
	
	jal pltTX
	move $t0, $v0
	li $t1, 4
	mult $t0, $t1
	mflo $t4
	
	jal pltTY
	move $t1, $v0
	mult $t1, $s3
	mflo $t1
	add $t4, $t4, $t1	
	
	move $t6, $a0
	la $a1, platformScale
	lw $a1, 0($a1)
	
	li $a2, 4
	mult $a1, $a2
	mflo $a1
	
	jal pltLen
	mult $a1, $v0
	mflo $a1
	
	move $a0, $t4
	
	la $t0, offsetY
	lw $t0, 0($t0)
	add $a0, $a0, $t0
	
	jal replaceCol
clrPltEnd:
	jr $t3

pltDir:	#Return platform movement type
	srl $v0, $a0, 7
	andi $v0, 1 #Mask to remove irrelevant data
	jr $ra

pltMv:	#Return platform movement type
	srl $v0, $a0, 5
	andi $v0, 3 #Mask to remove irrelevant data
	jr $ra	

pltLen:	#Return platform length
	srl $v0, $a0, 1
	andi $v0, 15 #Mask to remove irrelevant data
	jr $ra	

pltFX:	#Return platform x offset
	srl $v0, $a0, 12
	andi $v0, 15 #Mask to remove irrelevant data
	jr $ra
	
pltFY:	#Return platform y offset
	srl $v0, $a0, 8
	andi $v0, 15 #Mask to remove irrelevant data
	jr $ra
	
pltX:	#Return platform start x
	srl $v0, $a0, 24
	jr $ra

pltY:	#Return platform start y	
	srl $v0, $a0, 16
	andi $v0, 255 #Mask to remove irrelevant data
	sll $v0, $v0, 24
	sra $v0, $v0, 24
	jr $ra	

pltTX:
	move $t0, $ra
	jal pltX
	move $t1, $v0
	jal pltFX
	la $t2, platformScale
	lw $t2, 0($t2)
	mult $v0, $t2
	mflo $v0
	add $v0, $t1, $v0
	jr $t0

pltTY:
	move $t0, $ra
	jal pltY
	move $t1, $v0
	jal pltFY
	#li $t2, platformScale
	#mult $v0, $t2
	#mflo $v0
	add $v0, $t1, $v0
	jr $t0

getPC:	#Get current pc value
	move $v0, $ra
	jr $ra

QUIT:	li $v0, 10
	syscall
